import React, { useState } from 'react';
import Form from './Form';

function App() {
  fetch(
    'api.openweathermap.org/data/2.5/weather?q=Philadelphia&appid=09cb87e3b19945bb6949563cd21ace23'
  ).then(function (response) {
    console.log(response);
  });

  return <Form />;
}

export default App;
